        // add all the elements inside modal which you want to make focusable
        const focusableElements222 = 'button, [href], input, select, textarea, [tabindex]:not([tabindex="-1"])';
        const modal222 = document.querySelector('#modalLoginExpired'); // select the modal by it's id

        const firstFocusableElement222 = modal222.querySelectorAll(focusableElements222)[0]; // get first element to be focused inside modal
        const focusableContent222 = modal222.querySelectorAll(focusableElements222);
        const lastFocusableElement222 = focusableContent222[focusableContent222.length - 1]; // get last element to be focused inside modal

        document.addEventListener('keydown', function (e) {
            let isTabPressed = e.key === 'Tab' || e.keyCode === 9 || e.keyCode === 37 || e.keyCode === 38 || e.keyCode === 39 || e.keyCode === 40;

            if (!isTabPressed) {
                return;
            }

            if (e.shiftKey) { // if shift key pressed for shift + tab combination
                if (document.activeElement === firstFocusableElement222) {
                    lastFocusableElement222.focus(); // add focus for the last focusable element
                    e.preventDefault();
                }
            } else { // if tab key is pressed
                if (document.activeElement === lastFocusableElement222) { // if focused has reached to last focusable element then focus first focusable element after pressing tab
                    firstFocusableElement222.focus(); // add focus for the first focusable element
                    e.preventDefault();
                }
            }
        });

        firstFocusableElement222.focus();

    </script>

